/** @jsxImportSource @emotion/react */
import styled from "@emotion/styled";
import React from "react";
import { FaGithub, FaLinkedinIn, FaMediumM, FaInstagram } from "react-icons/fa";

const StyledIconHeader = styled.p`
  color: #aeff00;
  font-family: Kanit-Thin-Italic;
  transform: rotate(-90deg);
  padding: 10px;
`;

function AboutIcons() {
  return (
    <div style={{ color: "#aeff00", display: "flex" }}>
      <div className="linkedinIconContainer" style={{ display: "flex" }}>
        <a
          href="https://www.linkedin.com/in/john-schriemer-7955181a1/"
          target="_blank"
          style={{ textDecoration: "none", color: "#aeff00" }}
        >
          <StyledIconHeader>LinkedIn</StyledIconHeader>
          WORK EXP.
          <FaLinkedinIn
            size={70}
            style={{
              color: "black",
              position: "absolute",
              marginLeft: "120px",
              marginTop: "60px",
            }}
          />
        </a>
      </div>
      <div
        className="githubIconContainer"
        style={{ display: "flex", color: "#aeff00" }}
      >
        <StyledIconHeader>Github</StyledIconHeader>
        <p>PROJECTS</p>
        <a
          href="https://github.com/jschriemer"
          target="_blank"
          style={{ textDecoration: "none" }}
        >
          <FaGithub
            size={70}
            style={{
              color: "black",
              position: "absolute",
              marginLeft: "120px",
              marginTop: "60px",
            }}
          />
        </a>
      </div>
      <a
        href="https://medium.com/@jschriem"
        target="_blank"
        style={{ textDecoration: "none" }}
      >
        <div
          className="mediumIconContainer"
          style={{ display: "flex", color: "#aeff00" }}
        >
          <StyledIconHeader>Medium</StyledIconHeader>
          BLOG
          <FaMediumM
            size={70}
            style={{
              color: "black",
              position: "absolute",
              marginLeft: "120px",
              marginTop: "60px",
            }}
          />
        </div>
      </a>
      <a
        href="https://www.instagram.com/jschriem/"
        target="_blank"
        style={{ textDecoration: "none" }}
      >
        <div
          className="instagramIconContainer"
          style={{ display: "flex", color: "#aeff00" }}
        >
          <StyledIconHeader>Instagram</StyledIconHeader>
          PERSONAL
          <FaInstagram
            size={70}
            style={{
              color: "black",
              position: "absolute",
              marginLeft: "120px",
              marginTop: "60px",
            }}
          />
        </div>
      </a>
    </div>
  );
}

export default AboutIcons;
